import React from 'react'
import { useSelector } from 'react-redux';

const CheckoutPlaceorder = () => {
    const state = useSelector((state) => state.controlItems);
    const {
        cart: { shippingAddress, billingAddress, paymentMethod },
    } = state;
    console.log(state);

    const SendData = () => {
        return (
            <>
                <div className="col md-8">
                    <div className=" ">
                        <h5 className=" ">Envío </h5>
                        <p className=''>
                            <strong className='mx-2'>Nombre:</strong>{shippingAddress.fullName} <br />
                            <strong className='mx-2'>Rut:</strong>{shippingAddress.rut}
                            <strong className='ms-4 mx-2'>Tel.:</strong>{shippingAddress.addressPhone} <br />
                            <strong className='mx-2'>Nombre:</strong>{shippingAddress.fullName} <br />
                        </p>
                    </div>
                </div>
            </>
        );
    };

    const BillingData = () => {
        return (
            <>
                <p className=''>
                    <strong className='mx-2'>Tipo:</strong>{'Factura'} <br />
                    <strong className='mx-2'>Nombre:</strong>{billingAddress.name} <br />
                    <strong className='mx-2'>Rut:</strong>{billingAddress.rut}
                    <strong className='ms-4 mx-2'>Giro:</strong>{billingAddress.giro} <br />
                    <strong className='mx-2'>Dirección:</strong>{billingAddress.address}, {billingAddress.city}, {billingAddress.region}, {billingAddress.postal}<br />
                </p>

            </>
        );
    };
    const PaymentData = () => {
        return (
            <>
                <div className="row">
                    <div className="col md-3">
                        <h5 className=" ">Método de Pago </h5>
                        <p className=''>
                            <strong className='mx-2'>{paymentMethod}</strong>
                        </p>
                    </div>
                    <div className="col-lg-5 d-grid py-2 ">
                        <button className="btn btn-outline-primary btn-lg fw-bold" style={{ fontSize: '25px' }}>PAGAR</button>
                    </div>
                </div>
            </>
        );
    }
    return (
        <div className='col-9 mx-auto'>
            <h1 className='mb-3 text-center'>Revisa tu orden</h1>
            <div className="row">
                <SendData />
            </div>
            <div className="row mb-3">
                <div className="col md-8">
                    <div className="">
                        <div className=" ">
                            <h5 className=" ">Facturación </h5>
                            {billingAddress.type === 'invoice' ? <BillingData /> : <p className='card-text'><strong className='mx-2'>Boleta</strong></p>}
                        </div>
                    </div>
                </div>
            </div>
            <div className="row">
                <PaymentData />
            </div>
        </div>
    )
}

export default CheckoutPlaceorder
